void PrintSpaceGroupChiralInversion(void)
{
  int i;

  for(i=1;i<=NUMBER_OF_SPACEGROUPS;i++)
  {
    if(SpaceGroupData[i].Centric)
      fprintf(stderr, "%d\n",i);
  }

}


