int GetSpaceGroupFromHermannMauguinString(char *string)
{
  int i;
  char HM_symbol[100];

  if(strlen(string)>0)
  {
    // try 'long-name' with information on the origin, e.g. "P n n n:1"
    for(i=1;i<=NUMBER_OF_SPACEGROUPS;i++)
      if(strncasecmp(string,SpaceGroupData[i].LongInternationalHermannMauguinSpaceGroupSymbol,MAX2(strlen(string),
         strlen(SpaceGroupData[i].LongInternationalHermannMauguinSpaceGroupSymbol)))==0) return SpaceGroupData[i].Identifier;

    // try 'short-name' with information on the origin, e.g. "P n n n:1"
    for(i=1;i<=NUMBER_OF_SPACEGROUPS;i++)
      if(strncasecmp(string,SpaceGroupData[i].ShortInternationalHermannMauguinSpaceGroupSymbol,MAX2(strlen(string),
         strlen(SpaceGroupData[i].ShortInternationalHermannMauguinSpaceGroupSymbol)))==0) return SpaceGroupData[i].Identifier;

    // try 'long-name' without information on the origin, e.g. "P n n n" instead of "P n n n:1"
    for(i=1;i<=NUMBER_OF_SPACEGROUPS;i++)
    {
      sscanf(SpaceGroupData[i].LongInternationalHermannMauguinSpaceGroupSymbol,"%[^:]%*[^\n]",HM_symbol);
      if(strncasecmp(string,HM_symbol,MAX2(strlen(string),
         strlen(HM_symbol)))==0) return SpaceGroupData[i].Identifier;
    }

    // try 'short-name' without information on the origin, e.g. "P n n n" instead of "P n n n:1"
    for(i=1;i<=NUMBER_OF_SPACEGROUPS;i++)
    {
      sscanf(SpaceGroupData[i].ShortInternationalHermannMauguinSpaceGroupSymbol,"%[^:]%*[^\n]",HM_symbol);
      if(strncasecmp(string,HM_symbol,MAX2(strlen(string),
         strlen(HM_symbol)))==0) return SpaceGroupData[i].Identifier;
    }

  }
  return 0;
}

