      newpos.x=-pos.x; newpos.y=-pos.y; newpos.z=-pos.z; // Inversion center
      break;
    case 457: // [165] P -3 c 1 (-P 3 2"c)
      newpos.x=-pos.x; newpos.y=-pos.y; newpos.z=-pos.z; // Inversion center
