    case 471: // [177] P 6 2 2 (P 6 2)
    case 472: // [178] P 61 2 2 (P 61 2 (0 0 5))
    case 473: // [179] P 65 2 2 (P 65 2 (0 0 1))
    case 474: // [180] P 62 2 2 (P 62 2 (0 0 4))
