      newpos.x=-pos.x; newpos.y=-pos.y; newpos.z=-pos.z; // Inversion center
      break;
    case 495: // [201] P n -3 Origin choice 1 (P 2 2 3 -1n)
      newpos.x=-pos.x+1.0/2.0; newpos.y=-pos.y+1.0/2.0; newpos.z=-pos.z+1.0/2.0; // Inversion center
