    case 518: // [222] P n -3 n Origin choice 1 (P 4 2 3 -1n)
      newpos.x=-pos.x+1.0/2.0; newpos.y=-pos.y+1.0/2.0; newpos.z=-pos.z+1.0/2.0; // Inversion center
